import React, { Component } from "react";

class Logout extends Component {
  componentDidMount() {
    this.logout();
  }

  logout() {
    sessionStorage.setItem("data", "");
    sessionStorage.clear();
    this.setState({ redirect: true });
  }

  state = {};
  render() {
    return <div />;
  }
}

export default Logout;
